import path from 'path'

import { PluginOptions } from '@babel/core'

/**
 * Allows to whitelist certain node_modules to be processed by webpack.
 *
 * Credits: @jh3141
 * https://github.com/webpack/webpack/issues/2031#issuecomment-317589620
 *
 */
function excludeNodeModulesExcept(
  transpiledLibs?: string[] | boolean,
  nonTranspiledLibs?: string[] | boolean,
) {
  if (!transpiledLibs || !Array.isArray(transpiledLibs)) {
    return /node_modules/
  }

  let pathSep: typeof path.sep | string = path.sep
  if (pathSep === '\\') {
    // must be quoted for use in a regexp:
    pathSep = '\\\\'
  }
  const moduleRegExps = transpiledLibs.map(
    // eslint-disable-next-line security/detect-non-literal-regexp
    (modName: string) => new RegExp(`node_modules${pathSep}${modName}`),
  )

  return (modulePath: string) => {
    if (modulePath.includes('node_modules')) {
      // eslint-disable-next-line no-loops/no-loops
      for (const element of moduleRegExps) {
        if (
          nonTranspiledLibs &&
          Array.isArray(nonTranspiledLibs) &&
          nonTranspiledLibs.some((lib) => modulePath.includes(lib))
        ) {
          // eslint-disable-next-line no-continue
          continue
        }

        if (element.test(modulePath)) {
          return false
        }
      }
      return true
    }
    return false
  }
}

export interface WebpackLoadJavaScriptParams {
  babelConfig: PluginOptions
  options?: PluginOptions
  eslintConfigFile?: string | boolean
  sourceMaps: boolean
  transpiledLibs?: string[] | boolean
  nonTranspiledLibs?: string[] | boolean
}

export default function webpackLoadJavaScript({
  babelConfig,
  options = {},
  eslintConfigFile,
  sourceMaps,
  transpiledLibs = [],
  nonTranspiledLibs = [],
}: WebpackLoadJavaScriptParams) {
  return [
    eslintConfigFile && {
      test: /\.(js|jsx|ts|tsx|json)$/,
      exclude: /(node_modules)/,
      enforce: 'pre',
      use: [
        {
          loader: 'eslint-loader',
          options: {
            cache: true,
            configFile: eslintConfigFile,
            failOnError: true,
            quiet: false,
          },
        },
      ],
    },
    sourceMaps && {
      test: /\.(js|jsx|ts|tsx|css|sass|scss|json)$/,
      enforce: 'pre',
      use: [
        {
          loader: 'source-map-loader',
        },
      ],
    },
    {
      test: /\.(js|jsx|ts|tsx)$/,
      exclude: excludeNodeModulesExcept(transpiledLibs, nonTranspiledLibs),
      use: [
        {
          loader: 'babel-loader',
          options: {
            ...babelConfig,
            compact: false,
            cacheDirectory: true,
            cacheCompression: false,
            sourceMaps,
            ...options,
          },
        },
      ],
    },
    {
      test: /\.(mdx?)$/,
      use: [
        {
          loader: 'babel-loader',
          options: {
            ...babelConfig,
            compact: false,
            cacheDirectory: true,
            cacheCompression: false,
            sourceMaps,
            ...options,
          },
        },
        {
          loader: '@mdx-js/loader',
          options: {
            remarkPlugins: [require('remark-images'), require('remark-math')],
            rehypePlugins: [require('rehype-katex')],
          },
        },
      ],
    },
    {
      test: /\.ya?ml$/,
      type: 'json', // Required by Webpack v4
      use: 'yaml-loader',
    },
  ].filter(Boolean)
}

